script: |
  super -f text -I q9604.spq | sort > q9604.out

inputs:
  - name: q9604.spq
    data: |
      SELECT col2 AS col2 FROM tab1 (FORMAT parquet) WHERE + col2 * ( ( ( - col0 ) ) * col0 ) <= + 40 * 50 + - col0;
  - name: tab1

outputs:
  - name: q9604.out
    data: |
      59
      68
      96
